int hasPath(char grid[MAX_H][MAX_W], int H, int W) {
    // Create a visited array to keep track of visited cells
    int visited[MAX_H][MAX_W] = {0};

    // Initialize the starting cell as visited
    visited[0][0] = 1;

    // Perform a depth-first search (DFS)
    int stack[MAX_H * MAX_W][2];
    int top = 0;
    stack[top][0] = 0;
    stack[top][1] = 0;
    while (top >= 0) {
        int row = stack[top][0];
        int col = stack[top][1];
        top--;

        // Check if the destination cell is reached
        if (row == H - 1 && col == W - 1) {
            return 1; // Path found
        }

        // Explore adjacent cells
        if (row + 1 < H && grid[row + 1][col] == '.' && !visited[row + 1][col]) {
            visited[row + 1][col] = 1;
            top++;
            stack[top][0] = row + 1;
            stack[top][1] = col;
        }
        if (col + 1 < W && grid[row][col + 1] == '.' && !visited[row][col + 1]) {
            visited[row][col + 1] = 1;
            top++;
            stack[top][0] = row;
            stack[top][1] = col + 1;
        }
        if (row - 1 >= 0 && grid[row - 1][col] == '.' && !visited[row - 1][col]) {
            visited[row - 1][col] = 1;
            top++;
            stack[top][0] = row - 1;
            stack[top][1] = col;
        }
        if (col - 1 >= 0 && grid[row][col - 1] == '.' && !visited[row][col - 1]) {
            visited[row][col - 1] = 1;
            top++;
            stack[top][0] = row;
            stack[top][1] = col - 1;
        }
    }

    // No path found
    return 0;
}
